import React from 'react';
import HomePage from './pages/Home/HomePage';
import NotFoundPage from './pages/NotFound/NotFoundPage';

const routes = [
    {
        path : "/",
        exact : true,
        main : () => <Home />
    },
    {
        path : "",
        exact : false,
        main : () => <NotFound />
    }
];

export default routes;
